import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  return (
    <div>
      {props.contactsFromApp.map((contactObj, index) => (
        <Tile name={contactObj.name} description={contactObj.description} />
      ))}
    </div>
  );
};
